const initialState = {
  searchTerm: ""
};

const setSearchTerm = (state, action) => {
    return Object.assign({}, state, { searchTerm: action.payload });
}
const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default rootReducer;
